import React from 'react';
import {TextField, Grid,Typography, Stack} from '@mui/material'
import LoginForm from './LoginForm';
/**
 *  Login Main Component
 * 
 */

const Login = () => {
    return(
        <Grid container spacing={2}>
            <Grid item xs = {1} md = {4}>
              <LoginForm />
            </Grid>
        </Grid>
    );
}

export default Login;
